/* /src/component/Foot.js */
import React, { useState } from 'react';
import './Foot.css';
import TypewriterText from '../fx/TypewriterText';

const Foot = () => {

    return (
        <div className="foot" >
            <div className='icons'>
                <img src="https://avatars.githubusercontent.com/u/151031767?s=64&v=4" alt="Icon" className="navbar-icon" />
                <img src="data:image/png;base64," alt="Icon" className="navbar-icon" />
                <img src="/assets/icons/bootstrap.svg" alt="Bootstrap" width="32" height="32"></img>    
            </div>
        </div>
    );
};

export default Foot;
